const Home = () => {
    return (
      <>
         <nav className="bg-blue-500 p-4">
          <ul className="flex gap-12 text-white font-medium">
            <li>
              <NavLink 
                to="/" 
                className={({ isActive }) => isActive ? "text-yellow-300" : ""} 
                end
