                Home
              </NavLink>
            </li>
            <li>
              <NavLink 
                to="/about" 
                className={({ isActive }) => isActive ? "text-yellow-300" : ""}
              >
                About
              </NavLink>
            </li>
            <li>
              <NavLink 
                to="/services" 
                className={({ isActive }) => isActive ? "text-yellow-300" : ""}
              >
                Services
              </NavLink>

            </li>
            <li>
              <NavLink 
                to="/services" 
                className={({ isActive }) => isActive ? "text-yellow-300" : ""}
              >
                Services
              </NavLink>
              <NavLink 
                to="/contacts" 
                className={({ isActive }) => isActive ? "text-yellow-300" : ""}
              >
                Contacts
              </NavLink>
            </li>
          </ul>
        </nav>
  </>
    );
  };

  export default Home;
